script: |
  super -f text -I q99.spq | sort > q99.out

inputs:
  - name: q99.spq
    data: |
      SELECT DISTINCT 72 - - 44 * col2 col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT CAST ( - ( col0 ) AS REAL ) + - - col2 - + col1 * + - CAST ( NULL AS INTEGER ) / - col1 / - col1 >= ( + + col2 + - col1 );
  - name: tab0

outputs:
  - name: q99.out
    data: |
